// Set default icon color
//
// To add a new color, create a new case with the value and
// name of the color.

let fillColor
const ColorSwitch = propColor => {
  switch (propColor) {
    case "green":
      fillColor = "#00FF7F"
      break
    case "white":
      fillColor = "#FFFFFF"
      break
    case "red":
      fillColor = "#FF0055"
      break
    default:
      fillColor = "$logo-color-primary"
      break
  }
  return fillColor
}

